var db;
var dbCreated = false;


    db = window.openDatabase("EmployeeDirectoryDB", "1.0", "PhoneGap Demo", 200000);
    if (dbCreated)
        db.transaction(getEmployees, transaction_error);
    else
        db.transaction(populateDB, transaction_error, populateDB_success);


function transaction_error(tx, error) {
    $('#busy').hide();
    alert("Database Error: " + error);
}

function populateDB_success() {
    dbCreated = true;
    db.transaction(getEmployees, transaction_error);
}

function getEmployees(tx) {
    var sql = "select e.id, e.log, e.meaning " +
				"from LOGS e " +
				"order by e.log ASC";
    tx.executeSql(sql, [], getEmployees_success);
}

function getEmployees_success(tx, results) {
    $('#busy').hide();
    var len = results.rows.length;
    for (var i=0; i<len; i++) {
        var employee = results.rows.item(i);
        $('#employeeList').append('<a href="singleepidemiology.html?id=' + employee.id + '" class="list-group-item list-group-item-action">' + employee.log  + '</a></li>');
    }
    db = null;
}

function populateDB(tx) {
    $('#busy').show();
    tx.executeSql('DROP TABLE IF EXISTS LOGS');
    var sql =
    "CREATE TABLE IF NOT EXISTS LOGS ( "+
    "id INTEGER PRIMARY KEY AUTOINCREMENT, " +
    "log VARCHAR(100), " +
    "meaning LONGTEXT(1000) )";
    
    tx.executeSql(sql);


               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (1, "AGRUPAMENTU (CLUSTER)", "Agregasaun kazu husi moras ida ka kondisaun seluk relasiona ho saúde, liu-liu kánkru no defeitu desde moris, ne’ebe agrupa hamutuk tuir tempu no fatin. Númeru kazu bele liu ka la liu númeru espetativa; dala barak númeru espetativa de’it mos la hatene." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (2, "AJENTE", "Fatór ida, hanesan mikro-organismu, materiál substansia, ka iha forma radiasaun, ne’ebe nia prezensa barak liu, ka (iha moras ho defisiénsia) auzénsia relativa maka essensiál tebes hodi hamosu moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (3, "ALVU/TARJETU", "Objetivu espesífikadu ne’ebe hatudu númeru, tempu no fatin husi buat hirak ne’ebe atu atinje." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (4, "AMOSTRA", "Sub-grupu selesionadu husi populasaun ida. AMOSTRA bele aleatória ka la’os aleatória no bele reprezentativu ka la-reprezentativu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (5, "AMOSTRA ALEATÓRIA", "Amostra ida-ne’ebe liu husi selesiona individual ho maneira ida-ne’ebe individu ida-idak hetan probabilidade atu selesiona." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (6, "AMOSTRA REPREZENTATIVU", "Amostra ida-ne’ebe nia karaterítika koresponde ho populasaun original ka populasaun referénsia." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (7, "AMPLITUDE INTERKUARTÍL (RANGE INTERQUARTIL)", "Porsaun sentral husi distribuisaun ida, kalkuladu nudar diferensa entre kuartíl datolu no kuartíl dahuluk; amplitude ida-ne’e mos inklui sorin balun husi observasaun konjunta, husik hela um-quartu observasaun husi sorin ida idak." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (8, "AMPLITUDE(RANGE)", "Iha estatístika, diferensa entre valór bo’ot liu hotu no ki’ik liu hotu iha distribuisaun ida. Iha uzu komún, valór ne’ebe halekar husi ki’ik liu hotu to’o bo’ot liu hotu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (9, "AMPLITUDE-MÉDIU (MIDRANGE)", "Pontu sentral ka pontu dalan klaran husi observasaun konjuntu. Ba tipu dadus maiória, ne’e kalkula hanesan totál husi observasaun kiik liu hotu no observasaun bo’ot liu hotu, fahe ba rua. Ba dadus idade, aumenta ida ba numeradór. Amplitude-médiu bai-bain kalkula nudar etapa intermediáriu hodi determina sasukat sira seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (10, "ANÁLIZE PARTE-INTERESADA (STAKEHOLDER)", "Identifika parsialidade, espetativa, no preokupasaun husi ema, grupu, ka organizasaun ne’ebe bele influénsia ka hetan influénsia husi problema ka solusaun potensiál ba problema ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (11, "ASOSIASAUN", "Relasaun estatístika entre eventu, karaterístika rua ka liu, ka variável sira seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (12, "AUDITÓRIA", "Atividade garantia kualidade independente no objetivu ne’ebe dezeña atu aumenta valór no hadi’ak funsionamentu organizasaun. Ne’e ajuda organizasaun atu alkansa nia objetivu liu husi hala’o aprosimasaun sistemátika no disiplina atu avalia no hadi’ak efetividade husi jestaun risku, kontrolu no prosesu governasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (13, "AVALIASAUN", "Prosesu ida-ne’ebe buka atu determina ho sistemátika no ho objetivu karik bele relevansia, efetividade, no impaktu husi atividade tuir sira-nia objetivu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (14, "AVALIASAUN ESTERNA", "Avaliasaun ida-ne’ebe hala’o husi entidade li’ur no la’os mai husi programa ne’ebe hetan avaliasaun. Jeralmente, orgaun intergovernamental maka hala’o avaliasaun hanesan ne’e no simu relatóriu final kona baavaliasaun esterna. Tuir regulamentu, avaliasaun esterna ba projetu, programa ka sub-programa hala’o husi entidade livre husi kontrolu ka influensia husi sira ne’ebe responsabiliza ba dezeña no implementasaun ba projetu ka programa hirak ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (15, "AVALIASAUN INTERN", "Avaliasaun ne’ebe jere no/ka hala’o husi entidade iha programa nia laran ne’ebe hetan avaliasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (16, "BENEFISIÁRIU", "Individu, grupu, ka organizasaun ida, nudar alvu/tarjetu la’ós nudar alvu/tarjetu ida-ne’ebe indiretamente hetan benefísiu husi implementasaun programa, projetu ka Output." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (17, "DADUS INDIVIDUAL", "Dadus ne’ebe seidauk tau iha distribuisaun frekuénsia ka pozisaun ordenada." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (18, "DADUS KUALITATIVU", "Informasaun ne’ebe la’ós fasil atu hetan iha forma numérika (maske bele kuantifika dadus kualitativu). Dadus kualitativu tipikamente konsiste husi liafuan no normalmente deskreve ema nia opiniaun, koñesimentu, attitude ka hahalok." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (19, "DADUS KUANTITATIVU", "Informasaun ne’ebe sukat ka bele sukat ho, ka relasiona ho, kuantidade no espresa iha forma numérika. Dadus kuantitativu tipikamente konsiste husi númeru." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (20, "DEFINISAUN KAZU", "Komponente ida husi Padraun kritériu atu deside karik ema ida iha moras espesifiku ida ka kondisaun relasiona ho saúde, liu husi hala’o espesifikasaun ba kriteriu klínika no limitasaun ba tempu, fatin, no ema." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (21, "DENOMINADÓR", "Porsaun kraik liu husi fraksaun ida uza atu kalkula taxa ka rasio. Iha taxa, denominadór bai-bain maka populasaun ne’ebe iha risku (ka esperiénsia populasaun, hanesan ema-tinan, nst.)" )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (22, "DESVIU PADRAUN", "Sasukat ba dispersaun husi distribuisaun frekuénsia ida-ne’ebe uza barak liu, igual ho raíz kuadrada pozitivu husi variánsia ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (23, "DETERMINANTE", "Fatór ruma, karik eventu, karakterístika, ka entidade definidu seluk, ne’ebe lori mudansa ba kondisaun saúde ida, ka karakterístika definidu seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (24, "DIAGRAMA DISPERSAUN (SCATTER DIAGRAM)", "Gráfiku ida-ne’ebe pontu ida idak reprezenta valor pár ba variável kontíñuu rua, ho eixu-x reprezenta variável ida no eixu-y reprezenta variável ida seluk; uza atu hatudu relasaun entre variável rua ne’e; hanaran mósscatter-gram." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (25, "DISTRIBUISAUN", "Iha epidemiolojia, frekuénsia no modelu karaterístika relasiona-ho-Saúde no eventu iha populasaun ida. Iha statístika, valór frekuénsia observadu ka teorétika husi variável ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (26, "DISTRIBUISAUN FREKUÉNSIA", "Sumáriu kompletu husi valor ka kategoria frekuénsia husi variável ida; dala barak hatudu iha tabela koluna rua: koluna sorin karuk alista valor ka kategoria individual, koluna sorin kuanan hatudu númeru observasaun tuir kategoria ida idak." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (27, "DISTRIBUISAUN NORMAL", "Agrupamentu simétriku ba valor haleu fatin sentrál ida. Propriedade husi distribuisaun normal ida maka inklui hanesan tuir mai ne’e: (1) Distribuisaun kontínua no simétriku; ho ikun rua hasees ba sorin loos no karuk laiha rohan; (2) média aritmétika, modu, no mediu hanesan; no, (3) forma determina kompletamente husi média no desviu padraun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (28, "DOT PLOT", "Aprezentasaun vizuál husi pontu dadus ne’ebe atual husi variável la’os-kontíñuu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (29, "DROPLET NAMKARI", "Transmisaun direta ajente infesioza husi fatin rezervatóriu ba ospedeiru susetível ho anin ne’ebe namkari produz liu husi fani, mear, ka koalia." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (30, "DURASAUN MÉDIA BA BAIXA", "Númeru média loron kada pasiente internamentu iha ospitál ba epizódiu kuidadus ida idak. Kalkula hanesan kalkuladu liu husi dividi númeru total loron ne’ebe kama okupadu ba períodu ida ho númeru ketak-ketak iha períodu hanesan no espresa rezultadu hanesan média ba pasiente internamentu hotu-hotu ne’ebe alta, ka númeru média loron ne’ebe fornese servisu ba pasiente internamentu ida idak ne’ebe alta durante períodu determinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (31, "EFETIVIDADE", "Sasukat ida-ne’ebe hatudu programa/intervensaun ida atinje ona objetivu tuir kondisaun normal iha fatin moris loron loron." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (32, "EFIKÁSIA", "Sasukat ne’ebe hatudu oinsa intervensaun produz rezultadu ne’ebe spektativa tuir kondisaun ideál iha ambiente ne’ebe kontroladu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (33, "EFISIÉNSIA", "Sasukat ida-ne’ebe hatudu oinsa input ekonomikamente (rekursus hanesan fundus, esperiénsia, tempu) konverte sai rezultadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (34, "EKUIDADE", "Refere ba justu ka justisa iha prestasaun ka programa servisu. Ekuidade orizontal refere atu trata ema ho nesesidade hanesan, no ekuidade vertikal signifika katak ema ho nesesidade la hanesan tenke hetan mos tratamentu ne’ebe la hanesan." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (35, "ENKUADRAMENTU LÓJIKA", "Instrumentu jestaun ne’ebe uza atu hadi’a dezeña ba intervensaun. Ida-ne’e involve atu identifika elementu estratéjiku (input, Output, atividade, outcome, impaktu) no sira-nia relasaun kauzal, indikadór, no hanoin kona ba risku ne’ebe bele influensia susesu no failansu. Nune’e’e, bele fasilita planu, ezekusaun, no monitorizasaun & avaliasaun ba intervensaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (36, "EPIDEMIA", "Akontesimentu kazu moras barak husi ne’ebe la prevee iha area ida ka grupu ema espesífiku durante periódu tempu espesífiku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (37, "EPIDEMIOLOJIA", "Estudu kona ba distribuisaun no determinante estadu ka eventu relasiona-ho-saúde iha populasaun espesífiku, no aplikasaun husi estudu ida ne’e atu kontrola problema saúde." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (38, "EPIDEMIOLOJIA ANALÍTIKA", "Aspetu husi epidemiolojia hodi buka kauza no efeitu ne’ebe relasiona ho saúde. Uza grupu komparasaun, hodi fornese dadus liña-baze, atu sukat relasaun entre espozisaun no rezultadu (outcomes) no teste hipótezekona ba relasaun kauzal." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (39, "EPIDEMIOLOJIA DESKRITIVA", "Aspeitu ida husi epidemiolojia kona ba organiza no halo sumáriu ba dadus relasiona ho saúde bazeia ba tempu, fatin, no ema." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (40, "ERRU PADRAUN (HUSI MÉDIU)", "Desviu padraun husi distribuisaun teóriku ba média AMOSTRA kona ba média populasaun loloos." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (41, "ESKALA NOMINÁL", "Klasifikasaun ba katégoria kualitativu ne’ebe la-kategoriza/klasifika tuir orden; ezemplu: grupu etniku, relijiaun, no nasaun moris fatin nudar sasukat ba atributa individual ne’ebe mesak eskala nominal de’it, tamba laiha klasifikasaun natural ba sira-nia katégoria." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (42, "ESKALA ORDINÁL", "Klasifikasaun tuir katégoria kualitativu iha orden; ezemplu: klase sosiál (I, II, III, nst.) ida-ne’ebe valór sira iha orden diferente, maibe sira-nia katégoria mesak kualitativu no laiha distánsia naturál (numériku) entre nia valór pozitivu sira." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (43, "ESPESIFISIDADE", "Proporsaun ema ne’ebe laiha moras ne’ebe identifika ho loloos liu husi teste triajen ka definisaun kazu katak laiha moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (44, "ESPORÁDIKU", "Moras ida-ne’ebela akontese bebeik no la regular." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (45, "ESTATÍSTIKA INFERÉNSIA", "Iha estatístika, dezenvolvimentu kona ba jeneralizasaun husi dadus AMOSTRA, bai-bain kalkulanivel inserteza." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (46, "ESTATÍSTIKA VITAL", "Informasaun ho tabela sistematika kona ba moris, kabeen, divórsiu, no mate, bazeia ba rejistu husi eventu vital hirak ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (47, "ESTUDU ANALÍTIKU", "Estudu komparativu ho hanoin atu identifika no sukat relasaun, teste hipóteze, no identifika kauza. Iha tipu komún rua maka estudu kohort no estudu kazu kontrolu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (48, "ESTUDU ESPERIMENTÁL", "Estudu ida-ne’ebe investigador espesifika kategoria espozisaun ba individu ida idak (triajen klínika) ka komunidade (triajen komunidade), hafoin lao tuir individu ka komunidade atu deteta efeitu husi espozisaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (49, "ESTUDU KAZU-KONTROLU", "Tipu ida husi estudu analítiku observasionál. Inskrisaun ba estudu ne’e bazeia ba prezensa (“kazu”) ka auzensia (“kontrolu”) husi moras ida. Karaterístika hanesan espozisaun tempu uluk maka sei kompara entre kazu no kontrolu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (50, "ESTUDU KOORTE", "Tipu ida husi estudu analítiku observasionál. Inskrisaun ba estudu ne’e bazeia ba karaterístika espozisaun ka membru ba grupu ida. Moras, mate, ka rezultadus relasionada ho saúde seluk sei verifika lolós no kompara ba malu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (51, "ESTUDU OBSERVASIONAL", "Estudu epidemiolojiku iha situasaun ne’ebe natureza permite atu foti nia dalan rasik. Estuda mudansa ka diferensa iha karaterístika ida relasiona ho mudansa ka diferensa iha karaterístika sira seluk, la iha intervensaun husi investigadór ka peskizadór." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (52, "ETAPA-IMPORTANTE/MARKU MILIÁRIU", "Etapa-importante deskreve kurtu prazu no etapa konkretu ne’ebe sei hala’o hodi atinje objetivu programa iha tempu naruk. Hamutuk, marku no tarjetu tenke monitoriza uza enkuadramentu M&A nasional no definisaun indikadór ne’ebe konkorda ona." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (53, "FATÓR AMBIENTAL", "Fatór li’ur balun (jeolojia, klima, ular-oan, saneamentu, servisu saúde, nst.) ne’ebe afeta ajente ne’e no oportunidade ba espozisaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (54, "FATÓR OSPEDEIRU", "Fatór intrinsiku ida (idade, grupu étniku, seksu, hahalok, nst.) ne’ebe influensia susetibilidade espozisaun individual, ka resposta ba ajente kauzador." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (55, "FATÓR RISKU", "Aspetu husi ema nia hahalok ka estilu-moris, espozisaun ambientál, ka karaterístika ne’ebe hetan desde moris mai ka jenétika ne’ebe asosiadu ho aumentu iha akontesimentu moras ka eventu ka kondisaun seluk relasiona-ho-saúde." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (56, "FONTE KOMÚNBA SURTU", "Surtu ida-ne’ebe rezulta husi grupu ema ne’ebe hetan espozisaun ba influensia nosiva komún, hanesan ajente infesioza ka toxiku. Karik grupu ne’e hetan espozisaun durante periódu tempu badak, nune’e kazu hirak ne’e mosu iha periódu inkubasaun ida nia laran, nune’e fonte komún basurtu sei klasifika tuir mai hanesan fonte pontu ba surtu. Iha fonte komún ba surtu balun, ema bele hetan espozisaun durante períodu loron ba loron, semana, ka kleur liu tan, ho hetan espozisaun intermitente ka kontínua." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (57, "FREKUÉNSIA KUMULATIVA", "Iha distribuisaun frekuénsia, númeru ka proporsaun kazu ka eventu ho valór partikulár ka iha intervalu klasse partikulár, soma ho númeru totál ka proporsaun kazu ka eventu ho valór ki’ik husi variável ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (58, "FREKUÉNSIA POLÍGONU", "Gráfiku husi distribuisaun frekuénsia ho valor variável iha eixu-x no númeru observasaun iha eixu-y; pontu dadus reprezenta ho gráfiku iha pontu-médiu husi intervalu no liga ho liña loos ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (59, "GARANTIA KUALIDADE", "Prosesu sistemátiku no planeadu kona ba avalia no hadi’ak méritu ka valór husi intervensaun ida ka nia konformidade ho padraun determinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (60, "GRUPU ALVU/TARJETU", "Benefisiáriu prinsipal husi programa ka projetu ida-ne’ebe hein atu hetan rezultadu programa ka projetu ne’e. Sira ne’e iha relasaun besik malu ho nia impaktu no relevansia." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (61, "GRUPU RISKU AAS", "Grupu ida iha komunidade ne’ebe ho risku aas atu hetan moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (62, "GRÁFIKU", "Dalan ida atu hatudu vizualmente dadus kuantitativu, uza sistema koordinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (63, "GRÁFIKU BARRA", "Aprezentasaun visuál kona ba medida tuir kategoria oi-oin husi variável ida. Katégoria ka valór ida idak husi variável ne’e reprezenta husi barra ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (64, "GRÁFIKU KABUAR", "Gráfiku kabuar ne’ebe medida ba “fatia” ida idak proporsionál ho frekuénsia tuir katégoria variável ida idak." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (65, "HALI’IS (SKEWED)", "Distribuisaun ida ne’ebe la-simétriku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (66, "HANOIN BA SISTEMA", "Hanoin ba sistema maka aprosimasaun ida kona ba rezolve problema ne’ebe hare problema nudar parte husi sistema dinámiku ne’ebe bo’ot. Sistema maioria maka organiza an mesak, iha ligasaun metin, muda konstantamente no governa ho feedback." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (67, "HIPÓTEZE", "Supozisaun ida, ne’ebe mai husi observasaun ka reflesaun, ne’ebe lori ba estimativa hodi bele prova sala. Supozisaun saida de’it ne’ebe determina ho forma hodi permite atu hetan teste no prova katak sala." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (68, "HIPÓTEZE NULA", "Etapa dahuluk atu teste signifikansia estatístika ida-ne’ebe bele asume katak espozisaun la relasiona ho moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (69, "HIPÓTEZE, ALTERNATIVA", "Hipóteze ida-ne’ebe , sei adopta wainhira hipóteze nula prova katak la loos, ne’ebe espozisaun asosia ka relasiona ho moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (70, "IMPAKTU", "Efeitu tomak husi realiza rezultadu espesífiku. Iha situasaun balun impaktu mos inklui mudansa, planeadu ka la planeadu, pozitivu ka negativu, direta ka la direta, primáriu no sekundáriu ne’ebe programa ka projetu ida ajuda atu fó." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (71, "IMUNIDADE, ATIVU", "Rezisténsia ne’ebe dezenvolve hodi responde ba estimulu husi antijéniu ida (ajente infesaun ka vasina) no bai-bain karakteriza ho prezensa husi antikorpu ne’ebe ospedeiru produz." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (72, "IMUNIDADE, LUBUN (HERD)", "Rezisténsia husi grupu ida atu invade no habelar ajente infesioza, bazeia ba rezisténsia ba infesaun husi membru individu ho proporsaun aas iha grupu ne’e. Rezisténsia maka produtu ida husi númeru susetível no probabilidade ba sira-ne’ebe susetível sei iha kontaktu ho ema ne’ebe iha infesaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (73, "IMUNIDADE, PASIVA", "Imunidade ne’ebe mai husi antikorpu ne’ebe produz iha ospedeiru seluk no naturalmente, bebe ida hetan husi nia inan ka artifisialmente hetan husi administrasaun antikorpu ida ne’ebe iha preparasaun (antiserum ka imunoglobulina)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (74, "INDIKADOR", "Sasukat ida, liu-liu númeru, husi variável ne’ebe fornese baze ida razoávelmente simples no konfiável atu avalia realizasaun, mudansa ka dezempeñu. Unidade informasaun ida ne’ebe sukat durante tempu naruk ne’ebe bele ajuda hatudu mudansa iha kondisaun espesífiku ruma." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (75, "INDIKADÓR SAÚDE", "Sasukat ne’ebe refleta, ka hatudu, estadu saúde husi ema iha populasaun determinadu, ezemplu, taxa mortalidade infantil." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (76, "INFEKTIVIDADE", "Proporsaun husi ema ne’ebe espoinba ajente kauzativu no hetan infesaun husi moras infesioza." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (77, "INFORMASAUN DEMOGRÁFIKU", "“Ema” nia karaterístika-idade, seksu, grupu étniku, no okupasaun-husi epidemiolojia deskritiva ne’ebe uza atu karakteriza populasaun hirak ne’ebe iha risku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (78, "INPUTS", "Pesoál, finansas, ekipamentu, koñesimentu, informasaun no rekursus seluk ne’ebe presiza atu produz Outputs planeadu no atinje espetativa ba realizasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (79, "INTERVALU KLASE", "Espasu valor ida husi variável kontínua ne’ebe agrupa iha katégoria ida ba frekuénsia distribuisaun husi variável ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (80, "INTERVALU KONFIANSA", "Valor amplitude ba variável ne’ebe interese, nudar ezemplu: taxa, harii, no nune’e amplitude iha probabilidade espesifiku hodi inklui valór loloos husi variável. Probabilidade espesifiku ne’e maka bolu nivel konfiansa, no pontu ikus liu husi intervalu konfiansa maka hanaran limite konfiansa." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (81, "ISTOGRAMA", "Reprezentasaun gráfiku ba distribuisaun frekuénsia husi variável kontínua. Dezeñaretángulu ho maneira atu sira-nia baze tuur iha eskala linear reprezenta intervalu oin-oin, no sira-nia aas proporsionál ho valor frekuénsia iha intervalu ida idak nia laran." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (82, "ISTÓRIA NATURAL BA MORAS", "Periodu temporariu moras husi inisiu (hahú) to’o iha rezolusaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (83, "KAIXA-KETAN (BOX PLOT)", "Aprezentasaun vizuál ida-ne’ebe konklui dadus uza formatu “kaixa no hasan-rahun” atu hatudu valór sira ne’ebe mínimu no másimu (hasan-rahun tutun), amplitude interkuartíl (kaixa nia naruk), no mediu (liña liu husi kaixa ne’e)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (84, "KAUZA MORAS", "Fatór ida (karakterístika, hahalok, eventu, nst.) ne’ebe indiretamente influensia akontesimentu moras ida. Redusaun husi fatór ne’e iha populasaun bele mos halo redusaun ba akontesimentu moras ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (85, "KAUZA NESESÁRIA", "Fatór kauzal ida-ne’ebe prezensa presiza iha atu efeitu (husi moras) bele akontese." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (86, "KAUZA SUFISIENTE", "Fatór kauzál ida ka fator konjuntu ne’ebe iha sempre tuir ho akontesimentu husi efeitu (husi moras)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (87, "KAZU", "Iha epidemiolojia, akontesimentu ne’ebe bele konta iha populasaun ka grupu estudu ho moras espesifiku, problema saúde, ka kondisaun ida-ne’ebe hala’o hela investigasaun. Dala ruma, ema ida ho moras espesifiku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (88, "KOBERTURA UNIVERSAL BA SAÚDE (KUS)", "Kobertura Universal ba Saúde defini ona katak KUS iha dimensaun (tolu) 3-kobertura populasaun, disponibilidade servisus no protesaun finanseira." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (89, "KONFIABILIDADE", "Konsistensia ka konfiansa ba dadus ne’ebe halibur liu husi uza instrumentu scientífiku repetitivu ka prosedimentu halibur dadus ne’ebe uza iha kondisaun ne’ebe hanesan." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (90, "KONTAJIOZU", "Bele hada’et husi ema ida ba ema seluk liu husi kontaktu ka besik malu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (91, "KONTAKTU", "Espozisaun ba fonte infesaun ida, ka ema ne’ebe hetan ona espozisaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (92, "KONTROLU", "Iha estudu kazu-kontrolu, halo komparasaun ho grupu ema ne’ebe laiha moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (93, "KOORTE (COHORT)", "Grupu ema ne’ebe definidu didi’ak ne’ebe iha ona esperiénsia ka espozisaun komún, ne’ebe tuir nafatin / follow up hodi hare insidensia ba moras ka eventu foun, hanesan iha estudu koorte ka prospetiva. Grupu ema ne’ebe moris iha períodu ka tinan partikulár ida hanaran koorte nasimentu ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (94, "KORRENTE INFESAUN", "Prosesu ida-ne’ebe hahú wainhira ajente ida husik hela nia fatin rezervatóriu ka ospedeiru liu husi odamatan saí, no liu husi modu tranzmisaun balun, hafoin tama liu husi odamatan tama atu fó infesaun ba ospedeiru susetível ka vulneravel." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (95, "KURVA EPIDÉMIKA", "Istograma ida-ne’ebe hatudu durasaun moras surtu ida ka epidemia liu husi enkuadranúmeru kazu iha tempu nia mosu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (96, "KURVA FREKUÉNSIA KUMULATIVA", "Gráfiku kona ba frekuénsia kumulativa envez de frekuénsia atuál ba klasse intervalu ida-idak husi variável ida. Tipu gráfiku ida ne’e uza atu identifika mediu, kuartil, no persentil sira seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (97, "KURVA NORMAL", "Kurva ida-ne’ebe ho forma-sinu ne’ebe rezulta wainhira distribuisaun normal reprezenta iha gráfiku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (98, "KURVA SOBREVIVENSIA", "Kurva ida-ne’ebehahú ho 100% estudu populasaun no hatudu persentajen husi populasaun ne’ebe sei moris iha tempu tutuir malu wainhira iha disponibilidade ba informasaun. La’ós aplika de’it ba sobrevivensia ida hanesan ne’e, maibe mos ba persistensia liberdade husi moras ida, ka komplikasaun ka pontu-ikus sira seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (99, "LIMITE KONFIANSA", "Valór mínimu ka másimu husi intervalu konfiansa ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (100, "LIÑA-BAZE", "Dadus ne’ebe deskreve situasaun ne’ebe programa, sub-programa ka projetu ida atu atende, no serve nudar pontu hahú hodi sukat dezempeñu. Estudu liña-baze maka análiza hodi deskreve situasaun molok programa ka projetu ida hahú ka situasaun ida hafoin hahú programa ka projetu ida hodi sai nudar baze ba komparasaun no progresu ba análize iha futuru." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (101, "MAPA BA FATIN", "Mapa ida-ne’ebe hatudu fatin ba kazu moras ida idak ne’ebe ladun akontese barak ka surtu iha fatin ne’ebe potensialmente relevante ho eventu saúde ne’ebe hala’o investigasaun, wainhira kazu ida idak moris no servisu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (102, "MEDIU", "Sasukat ba lokalizasaun sentrál ne’ebe fahe dadus konjuntu ida ba parte rua hanesan." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (103, "META", "Deklarasaun lubun bo’ot kona ba outcome ne’ebe hakarak husi programa/intervensaun, normalmente ba tempu naruk nian. Metalespresa intensaun jeral husi programa/intervensaun no tulun orienta dezenvolvimentu programa/intervensaun. Meta ida idak iha komponente ne’ebe relasiona ho objetivu espesífiku no wainhira atinje, sei fó dalan ba realizasaun koletiva ba meta ne’ebe deklara ona." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (104, "MODU", "Sasukat lokalizasaun sentrál, valór ne’ebe maka mósu ho frekuénsia barak liu iha grupu observasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (105, "MONITORIZASAUN", "Avaliasaun periódika husi jestor kona ba progresu atu atinji espetativa ba Output no outcome. Monitorizasaun ne’e fornese garantia katak implementasaun husi programa ka projetu ida la’o tuir ona planu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (106, "MORAS ENDEMIA", "Moras ida ka ajente infesioza ida iha nafatin iha area jeográfika ka grupu populasaun ida nia laran; bele mos refere prevalensia bai-bain husi moras ida iha area ka grupu ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (107, "MORAS HIPERENDEMIKA", "Moras ida-ne’ebe iha nafatin de’it ho taxa insidensia no/ka prevalensia ne’ebe aas." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (108, "MORBILIDADE", "Saida, subjetivu no objetivu, husi estadu fisiolójiku ka moris-di’ak psikolójiku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (109, "MORTALIDADE PROPORSIONÁL", "Proporsaun mate iha populasaun espesifikadu durante períodu tempu determinadu ba kauza seluk. Kauza ida-idak espresa hanesan persentajen ba mate hotu-hotu, no totál kauza tenke soma hamutuk sai 100%. Proporsaun hirak ne’e la’ós taxa mortalidade, tamba nia denominadór maka mate hotu-hotu, la’ós populasaun ida ne’ebe mate sira ne’e akontese ba." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (110, "MÉDIA", "Sasukat ida-ne’ebe bai-bain uza ba tendénsia sentrál. Kalkula liu husi soma hamutuk valór individual hotu-hotu iha grupu sasukat no dividi ho númeru valór iha grupu ne’e. Hanesan mós Média Aritmétika." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (111, "MÉDIA, ARITMÉTIKA", "Sasukat ba lokalizasaun sentrál ne’ebe bai-bain hanaran média (average). Ne’e bele kalkula husi soma hamutuk valór individual hotu-hotu iha grupu no dividi ho númeru valor iha grupu ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (112, "MÉDIA, JEOMÉTRIKA", "Mean ka média husi dadus konjuntu ne’ebesukat iha eskala logaritmu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (113, "NUMERADÓR", "Porsaun leten husi fraksaun ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (114, "NÚKLEU DROPLET", "Restu husi droplet ne’ebe maran ne’ebe suspende hela iha anin durante períodu naruk, dalaruma hois iha anin husi distánsia do’ok, no fasil atu inspira tama ba pulmaun no ekspira sai ba liur." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (115, "OBJETIVU", "Deskrisaun ba atinjimentu espetativa jeral hodi involve prosesu mudansa no buka atu atinje nesesidade balun durante períodu tempu determinadu. Objetivu di’ak maka tuir kriteriá orienta ba impaktu, bele sukat, tempu limitadu, espesífiku no prátiku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (116, "OSPEDEIRU(HOST)", "Ema ida ka organismu moris seluk ne’ebe bele hetan infesaun husi ajente infesioza ho kondisaun natural." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (117, "OUTCOME", "“Outcome” uza hanesan sinónimu ba realizasaun ka rezultadu. Objetivu relasiona ho kobertura programa, no tenke sukat ho indikador outcome ba programa (ezemplu: % Kobertura DPT3) ka indikador Output ba programa (ezemplu: % fatin/postu ne’ebeprense ona)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (118, "OUTPUT", "Produtu final ka servisu ida-ne’ebe fornese husi programa ka projetu ba utilizador-ikus, hanesan relatóriu, publikasaun, servisu ba enkontru, treinamentu/formasaun, assesoria, editorial, tradusaun, ka servisu seguransa, ne’ebe programa ida hakarak atu produz hodi atinje espetativa ba realizasaun no objetivu. Output bele agrupa tuir katégoria bo’ot liu pur ezemplu Output ba rekursus umanus, Output ba korrente-malirin no lojístika, Output ba vijilánsia nst." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (119, "PANDEMIA", "Epidemia ida-ne’ebe akontese iha area luan tebes (nasaun barak ka kontinente) no bai-bain afeta proporsaun bo’ot husi populasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (120, "PARSIALIDADE (BIAS)", "Hasees rezultadu ka inferensia husi loloos, ka prosesu hodi lori ba desviu sistemátiku. Tendénsia balun ba tau hamutuk, análize, interpretasaun, publikasaun, ka revizaun dadus ne’ebe bele lori ba konkluzaun ne’ebe diferente husi loloos." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (121, "PATOJENIDADE", "Proporsaun husi ema sira-ne’ebe hetan infesaun, hafoin espozisaun ba ajente kauzativu, ne’ebe tuir mai dezenvolve moras klíniku." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (122, "PERIÓDU EPIDEMIKA", "Periódu tempu wainhira númeru kazu moras ne’ebe relata bo’ot liu husi ida ne’ebe ita espera." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (123, "PERIÓDU INKUBASAUN", "Períodu ida husi mudansa patolójiku sub-klíniku ka ida-ne’ebe la klaru hafoin espozisaun, termina ho mosu simtomas husi moras infesioza." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (124, "PERSENTIL", "Númeru konjuntu husi 0 to’o 100 ne’ebefahe distribuisaun ba iha partes área 100 hanesan, ka fahe dadus konjuntu klasifikadu ba produtu intervalu 100 nia laran ho intervalu ida idak iha 1/100 husi observasaun. Persentil espesifiku, bele dehan persentil ba dala 5, maka pontu klaran ho 5 pursentu husi observasaun iha nia kraik no 95% husi observasaun iha nia leten." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (125, "PERÍODU LATÉNSIA", "Períodu ida husi alterasaun patolójiku sub-klíniku ka ida ne’ebe la klaru hafoin espozisaun, termina ho hahú mosu simtomas husi moras krónika." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (126, "PERÍODU PREVALÉNSIA", "Kuantidade husi moras espesifiku ida-ne’ebe hatudu iha populasaun ida durante períodu tempu ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (127, "PLANU MONITORIZASAUN & AVALIASAUN", "Estratejia implementasaun tinan-barak ba kolesaun, análize no utilizasaun dadus ne’ebepresiza ba jestaun projetu/programa no objetivu ba kontabilidade." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (128, "PONTU PREVALÉNSIA", "Kuantidade husi moras espesifiku ida-ne’ebe mosu iha populasaun pontu mesak iha tempu determinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (129, "POPULASAUN", "Númeru totál populasaun iha área ka nasaun ida. Iha amostra, populasaun bele refere ba unidade ne’ebe foti amostra, la presiza totál populasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (130, "PORTADOR", "Ema ka animál ida ne’ebe la hatudu moras vizivel ne’ebe subar ajente infesioza espesífiku no bele hada’et ajente ne’e ba ema seluk. Estadu portador bele mosu ba ema ida ho infesaun ne’ebe la klaru durante nia kursu/periódu tomak (hanaran nudar portador asintomátiku), ka durante períodu inkubasaun, konvalesensa, no pós-konvalesensa ba ema ida ne’ebe klínikamente bele rekoñese moras. Estadu portador bele akontese iha durasaun badak ka naruk (portador tranzitóriu ka portador króniku)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (131, "PREKAUSAUN UNIVERSÁL", "Rekomendasaun hasai husi CDC atu minimiza risku tranzmisaun patójeniku hada’et liu husi raan, liu-liu HIV no HBV, husi kn’ar na’in kuidadus saúde no seguransa públika. Prekausaun barreira uza atu prevene espozisaun ba raan no fluidu/isin ben husi pasiente hotu-hotu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (132, "PREVALENSIA", "Númeru ka proporsaun kazu ka eventu ka kondisaun iha populasaun determinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (133, "PROGRAMA", "Resposta nasional ka sub-nasional konjunta ba moras ida. Jeralmente, Programa ida inklui hala’o intervensaun konjunta atu atinji objetivu espesífiku global, rejionál, nasaun, ka sub-nasional; involve atividade barak ne’ebe bele hala’o iha setór , tema no/ka área jeográfika oi oin." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (134, "PROJETU", "Intervensaun ida-ne’ebe dezeña atu atinje objetivu espesífiku iha rekursus espesifikadu no oráriu implementasaun nia laran, dala barak iha enkuadramentu ba programa tomak nia laran." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (135, "PROPORSAUN", "Tipu rasio ida-ne’ebe nia numeradór mos inklui iha denominadór. Rasio husi parte ida ba konjuntu/tomak, espresa nuúdar “frasaun desimal” (ezemplu: 0.5), hanesan frasaun (1/2), ka, indeterminadu, hanesan persentajen ida (50%)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (136, "PROPORSAUN ATRIBUÍDA", "Sasukat ba impaktu saúde públika husi fatór kauza; proporsaun husi moras iha grupu ida-ne’ebe iha ona espozisaun ba fatór partikulár ida ne’ebe bele atribui ba sira-nia espozisaun husi fatór ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (137, "RASIO", "Valór ne’ebe hetan liu husi kompara kuantidade ida ho kuantidade seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (138, "RASIO MATE BA KAZU", "Númeru mate ne’ebe atribui ba moras espesifiku ida durante períodu tempu espesifikadu dividi ho númeru kazu foun husi moras ne’e ne’ebe identifika durante períodu tempu hanesan." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (139, "RASIO MORTALIDADE MATERNA (RMM)", "Rasio mortalidade materna maka rasio númeru inan mate ba kada 100,000 bebe ne’ebe foin moris ne’ebe moris husi kauza ne’ebe relasiona ho ka hatodan tamba isin-rua ka nia jestaun, exklui kauza asidentál ka insidentál." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (140, "RASIO ODDS (ODDS RATIO)", "Sasukat ida kona ba asosiasaun ne’e be sukat relasaun entre espozisaun no outcome saúde husi estudu komparativu ida; ne’e mós hanaran nudar rasio kruza-produtu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (141, "RASIO RISKU", "Komparasaun risku husi eventu balun relasiona-ho-saúde hanesan moras ka mate iha grupu rua." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (142, "RELEVANSIA", "Sasukat ida-ne’ebe hatudu objetivu, Outputs, ka outcomes husi intervensaun ida maka konsistente ho rekizitus husi benefisiáriu, polítika organizasaun, nesesidade nasaun, no/ka prioridade global." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (143, "REZERVATÓRIU", "Horik-fatin, ida-ne’ebe ajente infesioza ida normalmente moris, sai bo’ot no sai barak; rezervatóriu inklui rezervatóriu umanu, rezervatóriu animal, no rezervatóriu ambientál." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (144, "RISKU", "Probabilidade ne’ebe ventu ida sei akontese, ezemplu: ne’ebe ema ida sei moras ka mate iha períodu tempu ka idade ne’ebe determinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (145, "RISKU RELATIVU", "Komparasaun risku husi eventu balun relasiona-ho-saúde hanesan moras ka mate iha grupu rua." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (146, "SASUKAT BA ASOSIASAUN", "Relasaun númeru entre espozisaun no moras; inklui risku relativu, rasio taxa, odds ratio." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (147, "SASUKAT BA DISPERSAUN", "Sasukat ba dispersaun ba distribuisaun husi ninin ba valór sentrál. Sasukat ba dispersaun ne’ebe uza iha epidemiolojia inklui amplitude interkuartíl, variánsia, no desviu padraun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (148, "SASUKAT LOKALIZASAUN SENTRÁL", "Valor sentrál ida-ne’ebe reprezenta di’ak liu hotu distribuisaun dadus. Sasukat lokalizasaun sentrál maka inklui mean, mediu, no moda. Hanaran mos sasukat tendénsia sentrál." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (149, "SAZONALIDADE (SEASONALITY)", "Mudansa iha estadu fisiolójiku ka iha akontesimentu moras ne’ebe la’o tuir modelu sazonal regular ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (150, "SAÚDE", "Estadu ida ho bem-estár fízika, mentál, no sosiál kompletu no la’ós de’it la iha moras ka enfermidade." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (151, "SENSITIVIDADE", "Abilidade husi sistema ida atu deteta epidemia no mudansa seluk ba akontesimentu moras. Proporsaun ema ho moras ne’ebe identifika ho loloos liu husi teste triajen ka definisaun kazu wainhira hetan moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (152, "SENSUS", "Resenseamentu populasaun tomak, bai-bain rejista ho detallu kona ba rezidénsia/hela fatin, idade, seksu, okupasaun, grupu etniku, estadu sivíl, istória kona ba nasimentu, no relasaun ho xefe família." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (153, "SISTEMA INFORMASAUN SAÚDE", "Kombinasaun husi estatístika saúde husi fontes oin-oin, uza atu hetan informasaun kona ba estadu saúde, kuidadus saúde, fornesimentu no uza servisu, no impaktu ba saúde." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (154, "SISTEMA SAÚDE HARII BLOKU", "Komponente oin-oin husi sistema saúde ne’ebe hala’o interasaun no liga ba malu atu forma sistema ne’ebe kompletu. Bloku oin-oin maka konsidera hanesan: Prestasaun Servisu, Forsa-servisu ba Saúde, Informasaun Saúde, Teknolojia Médika, Finansiamentu Saúde no Lideransa & Governasaun. Iha kontextu balun, “sistema komunidade” mos konsideradu nudar ligasaun distintu husi sub-sistema." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (155, "SUPERVIZAUN SUPORTIVU", "Supervizaun suportivu mak “prosesu ida ne’ebe promove kualidade iha nivel hotu-hotu husi sistema saúde liu-husi hametin relasaun iha sistema nia laran, foka ba identifikasaun no rezolusaun ba problema, no tulun hodi utiliza maksimu alokasaun rekursus-promove padraun aas, ekipa servisu, no komunikasaun di’ak ba malu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (156, "SURTU", "Sinónimu ho epidemia. Dala ruma prefere liu liafuan ne’e, tamba nia bele ha sees husi sensasaun/sentimentu ne’ebe asosia ho liafuan epidemia. Alternativamente, epidemia lokalizada kontráriu ho epidemia jeneralizada." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (157, "SURTU NE’EBEHABELAR", "Surtu ida-ne’ebe laiha fonte komún, maibe halekar husi ema ba ema." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (158, "TABELA", "Dadus konjustu ida-ne’ebe organiza iha liña no koluna." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (159, "TABELA KONTINJÉNSIA", "Tabela variável rua ho dadus tabela-kruzada." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (160, "TABELA SHELL", "Tabela ida-ne’ebe kompletu eseptu dadus." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (161, "TAXA", "Espresaun ba frekuénsia husi eventu ne’ebe akontese iha populasaun definidu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (162, "TAXA ATAKE", "Variasaun ida husi taxa insidensia, aplika ba populasaun definidu ki’ik ida ne’ebe observa durante períodu tempu limitadu, hanesan durante epidemia ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (163, "TAXA ATAKE SEKUNDÁRIA", "Sasukat ba frekuénsia husi kazu moras foun entre kontaktu/ema sira ho kazu ne’ebe hatene." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (164, "TAXA EMA-TEMPU", "Sasukat ba taxa insidensia husi eventu ida, ezemplu: moras ka mate, iha populasaun risku durante períodu tempu observadu, ne’ebe direitamente inkorpora tempu ba iha denominadór nia laran." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (165, "TAXA FATALIDADE KAZU", "Proporsaun ema ho kondisaun (kazu) espesifiku ne’ebe mate tan kondisaun ne’e. Denominadór maka númeru kazu insidensia; numeradór maka númeru mate husi kauza espesífiku entre kazu hirak ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (166, "TAXA FERTILIDADE TOTÁL", "Númeru médiu (average no.) labarik, ne’ebe feto ida ho posibilidade (hypothetical cohort) atu hetan durante periodu/idade reproductiva, karik durante sira nia moris tomak sujeitu ba taxa fertilidade iha periódu ida no se sira la sujeitu ba mortalidade. Ida ne’e hatudu numerú labarik hira pur kada feto." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (167, "TAXA INSIDENSIA", "Sasukat kona bafrekuénsia husi eventu, hanesan kazu moras foun, ne’ebe mosu iha populasaun durante períodu tempu balun. Denominadór maka populasaun ne’ebe iha risku; numeradór maka númeru kazu foun mosu durante períodu tempu determinadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (168, "TAXA KRESIMENTU", "Kuantidade aumentu ne’ebe variavel espesífiku atinje durante periódu no kontextu espesífiku ida nia laran. Ezemplu: Taxa Kresimentu Populasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (169, "TAXA MORTALIDADE", "Sasukat kona ba frekuénsia akontesimentu mate iha populasaun determinadu durante tempu intervalu ne’ebe espesifika." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (170, "TAXA MORTALIDADE BRUTU", "Taxa mortalidade ba kauza hotu-hotu husi mate iha populasaun ida." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (171, "TAXA MORTALIDADE ESPESÍFIKA TUIR IDADE", "Taxa mortalidade ida ne’ebe limite de’it ba grupu idade partikular. Numeradór maka númeru ema mate husi grupu idade ne’e; denominadór maka númeru ema iha grupu idade ne’e iha populasaun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (172, "TAXA MORTALIDADE ESPESÍFIKU-SEKSU", "Taxa mortalidade entre feto ka mane." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (173, "TAXA MORTALIDADE HO AJUSTAMENTU TUIR IDADE", "Taxa mortalidade ne’ebe modifika estatistikamente hodi halakon efeitu husi distribuisaun idade ne’ebe la hanesan iha populasaun ne’ebe diferente." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (174, "TAXA MORTALIDADE INFANTIL", "Rasio ida-ne’ebe hatudu númeru mate iha labarik idade menus husi tinan ida ne’ebe relata durante periódu tempu determinadu kompara ho númeru bebe foin moris ne’ebe moris relata durante periodu tempu hanesan. Taxa mortalidade infantil bai-bain espresa hanesan pur 1,000 bebe foin moris ne’ebe moris." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (175, "TAXA MORTALIDADE KAUZA ESPESÍFIKA", "Taxa mortalidade husi kauza espesifika ba populasaun ida. Numeradór maka númeru mate atribuí ba kauza espesífika ida durante intervalu tempu espesifikadu; denominadór maka pontu sentral númeru populasaun iha tempu intervalu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (176, "TAXA MORTALIDADE LABARIK IDADE TINAN LIMA MAI KRAIK", "Probabilidade husi labarik moris iha tinan ka períodu espesífiku ne’ebe mate molok kompleta tinan lima, karik hare tuir taxa mortalidade idade-espesífika ba períodu ne’e." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (177, "TAXA MORTALIDADE MATERNA", "Taxa mortalidade materna defini hanesan númeru inan ne’ebe mate iha periódu tempu determinadu ba kada 100,000 feto ho idade reprodutiva, ka tinan-ba-feto ho risku ba espozisaun, iha períodu ne’ebe hanesan." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (178, "TAXA MORTALIDADE NEONATAL", "Rasio ida-ne’ebe hatudu númeru mate iha labarik idade husi moris to’o loron 27 (maibe la inklui loron 28) kompara ho númeru bebe foin moris ne’ebe moris no relata durante periodu tempu hanesan. Taxa mortalidade neonatal bai-bain espresa hanesan pur 1,000 bebe foin moris ne’ebe moris." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (179, "TAXA MORTALIDADE PERINATAL", "Rasio husi númeru totál fetal ne’ebe mate ho jestasaun depois de semana 22 ka liu (bebe mate iha inan nia kanotak antes inan tuur-ahi ) no bebe ne’ebe mate ho idade menus husi loron 7 iha períodu tempu hanesan no ho númeru totál bebe foin moris ne’ebe moris no fetal ne’ebe mate ho jestasaun depois de semana 22 ka liu (bebe mate iha inan nia kanotak antes inan tuur-ahi) iha períodu tempu no populasaun hanesan." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (180, "TAXA MORTALIDADE PÓS-NEONATAL", "Rasio ne’ebe hatudu númeru mate iha labarik ho idade husi loron 28 to’o idade menus husi tinan ida (la inklui tinan 1) durante períodu tempu determinadu kompara ho númeru bebe ne’ebe foin moris ne’ebe moris relata durante períodu tempu hanesan. Taxa mortalidade pós-neonatal bai-bain espresa hanesan pur 1,000 bebe ne’ebe foin moris ne’ebe moris." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (181, "TAXA OKUPASAUN KAMA", "Persentajen husi kama ne’ebe disponivel, ne’ebe okupa tiha ona durante períodu determinadu. Kalkula liu husi dividi númeru loron ba kama okupadu iha períodu ida, husi númeru loron ba kama ne’ebe disponivel ba períodu hanesan, no rezultadu hatudu liu husi persentajen. Indikador ne’e nudar sasukat ba intensidade husi rekursus ospitál ne’ebe uza husi pasiente internamentu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (182, "TAXA PREVALENSIA", "Proporsaun ema iha populasaun ida ne’ebe iha moras ka atributu espesifiku ida iha pontu tempu espesífikadu ka durante períodu tempu espesífikadu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (183, "TAXA RASIO", "Komparasaun entre grupu rua en termus ba taxa insidénsia, taxa ema-ba-tempu, ka taxa mortalidade." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (184, "TENDÉNSIA (TREND)", "Movimentu ka mudansa tempu-naruk iha frekuénsia, bai-bain movimenta ba leten kaba kraik." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (185, "TENDÉNSIA SEKULÁR", "Mudansa durante períodu tempu naruk, jeralmente tinan barak ka dékada." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (186, "TINAN POTENSIÁL LAKON VIDA", "Sasukat ba impaktu mortalidade prematura iha populasaun ida, ne’ebe kalkula hanesan totál husi diferensa entre durasaun moris predeterminada mínimu ka dezeju balun no idade wainhira mate ba individual sira-ne’ebe mate sedu tuir sira-nia idade predeterminada." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (187, "TRANSMISAUN DIRETA", "Transferénsia imediata ajente ida husi nia fatin rezervatóriu ba ospedeiru ne’ebe susetível liu husi kontaktu direta ka habelar." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (188, "TRANZMISAUN BA INFESAUN", "Modu ka mekanismu ruma ne’ebe ajente infesioza ida uza atu halekar liu husi ambiente ka ba ema seluk." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (189, "TRANZMISAUN BIOLÓJIKA", "Tranzmisaun indireta liu husi vetor ajente infesioza ida-ne’ebe ajente ne’e rasik hala’o mudansa biolójika iha vetor nia laran molok hada’et ba ospedeiru foun." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (190, "TRANZMISAUN INDIRETA", "Tranzmisaun husi ajente ida lori husi rezervatóriu ba ospedeiru susetível liu husi partíkula ne’ebe suspende hela iha anin ka husi intermediáriu buat moris (vetor) ka inanimadu ka sasan mate (veíkulu)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (191, "TRÍADE EPIDEMIOLÓJIKA", "Modelu tradisional husi kauza moras infesioza. Inklui komponente tolu: ajente externa, ospedeiru susetível, no ambiente ne’ebe lori hamutuk ospedeiru no ajente, hodi hamosu moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (192, "VALIDADE", "Grau ne’ebe hatudu sasukat ida ne’ebe agora daudaun sukat ka deteta saida maka hakarak sukat." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (193, "VALOR REFERÉNSIA (BENCHMARK)", "Pontu referénsia ka padraun ne’ebe uza hodi avalia dezempeñu ka realizasaun servisu. Valor referénsia ne’e dala barak refere nudar alvu/tarjetu intermediáriu atu sukat progresu iha períodu determinadu ida hanesan mos sukat dezempeñu husi entidade organizasaun sira-ne’ebe bele kompara." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (194, "VALÓR PREDITIVU POZITIVU", "Sasukat ida ba valór preditivu husi kazu ka epidemia ne’ebe relata; proporsaun kazu relata husi sistema vijilánsia ka klasifika tuir definisaun kazu ne’ebe kazu lo’os duni." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (195, "VARIÁNSIA", "Sasukat ba dispersaun ne’ebe hatudu liu husi observasaun konjunta, defini liu husi soma ho kuadradu desviu husi média, dividi ho númeru grau liberdade iha observasaun konjunta." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (196, "VARIÁVEL", "Karaterístika ka atributu ne’ebe bele sukat." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (197, "VARIÁVEL DEPENDENTE", "Iha análize statístika, variável(s) rezultadu/outcome ka variável(s) ne’ebe valór maka sai nudar funsaun ba variável(s) seluk (hanaran variável(s) independente iha relasaun ba estudu ne’e)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (198, "VARIÁVEL INDEPENDENTE", "Espozisaun ida, fatór risku, ka karaterístika seluk ne’ebe hetan observasaun ka sasukat ne’ebe iha hipóteze atu influensia eventu ka manifestasaun ruma (variável dependente)." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (199, "VETÓR", "Intermediáriu animadu ka buat moris ba iha tranzmisaun indireta husi ajente ida-ne’ebe lori ajente husi rezervatóriu ba ospedeiru susetível." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (200, "VEÍKULU", "Intermediáriu inanimadu ka sasan la-moris ba iha tranzmisaun indireta husi ajente ida-ne’ebe lori ajente husi rezervatóriu ba ospedeiru susetível." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (201, "VIJILANSIA", "Kontínua halibur, análiza no interpreta dadus kona ba moras, no disemina konkluzaun husi análize ba organizasaun relevante. Iha tipu tolu" )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (202, "VIJILANSIA SAÚDE PÚBLIKA", "Koleksaun, análize, interpretasaun, diseminasaun sistemátika ba dadus saúde tuir baze kontínua, atu hetan koñesimentu ba modelu akontesimentu no potensial moras iha komunidade ida, atu bele kontrola no prevene moras ne’e iha komunidade." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (203, "VIJILANSIA SENTINELA", "Sistema vijilansia ida-ne’ebe AMOSTRA pré-estabelesidu ba fontes relatóriu konkorda atu relata kazu hotu-hotu husi notifikasaun ba kondisaun ida ka liu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (204, "Vijilánsia ativa", "Peskiza espesial ne’e hala’o atu buka no hetan kazu iha komunidade, liu-liu husi levantamentu husi uma ba uma. Ne’e inklui mos halibur informasaun intensional husi instituisaun no kn’ar na’in saúde." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (205, "VIJILÁNSIA MÉDIKA", "Hala’o monitorizasaun ba individual hirak ne’ebe potensialmente espoin hodi bele deteta sedu simtomas moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (206, "Vijilánsia Pasiva", "Relata ho rutina kazu moras ne’ebe to’o iha fasilidade kuidadus saúde atu hetan tratamentu ka prestasaun servisu. La halo esforsu espesial ida atu lokaliza insidente moras ne’ebe la suspeita. Vijilánsia pasiva normalmente deteta de’it moras ba sira ne’ebe hetan moras, signifika katak portadór saudável no períodu inkubasaun ne’ebe kleur kombina ho vijilánsia pasiva bele mantein rezervatóriu husi la deskobre ajente ne’ebe lori moras." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (207, "Vijilánsia sentinela", "Sistema relatoriu bazeia ba instituisaun ka individual ne’ebe selesionadu hodi fornese relatóriu regular no kompletu kona ba moras ida ka liu ne’ebe mosu ho ideal iha anexu definidu. Ne’e mos fornese dadus adisional kona ba kazu." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (208, "VIRULÉNSIA", "Proporsaun ema ho moras klínika, ne’ebe depois hetan infesaun, sai moras todan liu ka mate." )');
               tx.executeSql('INSERT INTO LOGS (id, log, meaning) VALUES (209, "ZOONOZE", "Infesaun ida-ne’ebe bele tranzmite tuir kondisaun normal." )');
               }
